const { Sequelize: { Model } } = require( 'sequelize' );
const { UserOnlineMerchant: UserOnlineMerchantSchema } = require( '../schema' );

class UserOnlineMerchant extends Model {}

module.exports = sequelize => {

    UserOnlineMerchant.init( UserOnlineMerchantSchema, { sequelize, tableName: 'user_online_merchants', underscored: true, timestamps: true } );
    return UserOnlineMerchant;

};
